<p><strong>Please note the following</strong>:<p>

<ul>
  <li>This article is supporting documentation for our tutorial, <a href='/support/edu/joomla-3/docblocks'>using DocBlocks in Joomla</a>.</li>
  <li>There is <a href='http://joomla.github.io/coding-standards/?coding-standards/chapters/docblocks.md' target='_blank'>official documentation</a> that references what headers to use in your DocBlocks (such as @copyright and @license), but documentation is missing that outlines what values to use for each header.</li>
  <li class='alert alert-success'>In an effort to learn what values to use per each header, we have scanned the Joomla code and pulled out how each header is used. The idea behind this page is to show you how the <strong>@return</strong> tag has been used in the past within the Joomla code so learn how to use it in your future documentation.</li>
</ul>


